import React from 'react'

export default function Contactus() {
    function showForm() {
        document.getElementById('formElement').style.display = 'block';
    }
  return (
    <div>

    <h1><center>Meal Rescue India</center></h1>
    <div class="img"><img style={{length:"400px" , width:"400px"}}/></div>
    <div class="para"><p>Our "Community Food Waste Reduction and Redistribution" website is committed to making a positive impact on our local community and the environment. We believe that every small effort counts when it comes to reducing food waste and ensuring that nutritious food reaches those who need it most. We welcome your thoughts, ideas, and collaboration to make a meaningful difference in our shared mission. Whether you have suggestions for reducing food waste at home, want to volunteer with our initiatives, or have partnerships in mind, we'd love to hear from you. Contact us today to join our community-driven effort to create a more sustainable and compassionate world, one meal at a time. Together, we can make a substantial impact on food waste reduction and the well-being of our neighbors.</p>
</div>

<center><button onclick="showForm()"  >CONTACT US
</button></center>  
<form class="form" id="formElement" style="display: none;">
    <h2>CONTACT US</h2>
    <p type="Name:"><input placeholder="Write your name here.."></input></p>
    <p type="Email:"><input placeholder="Let us know how to contact you back.."></input></p>
    <p type="Message:"><input placeholder="What would you like to tell us.."></input></p>
    <button>Send Message</button>

  </form>


    </div>
  )
}
